#include <algorithm>
#include <deque>
#include <string>
#include <cassert>
#include <iostream>

using namespace std;

struct Ticket {
    int id;
    string name;
};

class TicketOffice {
public:
    // Ð´Ð¾Ð±Ð°Ð²Ð¸Ñ‚ÑŒ Ð±Ð¸Ð»ÐµÑ‚ Ð² ÑÐ¸ÑÑ‚ÐµÐ¼Ñƒ
    void PushTicket(const string& name) {
        ++last_id_;
        tickets_.push_back({ last_id_, name });
    }

    // Ð¿Ð¾Ð»ÑƒÑ‡Ð¸Ñ‚ÑŒ ÐºÐ¾Ð»Ð¸Ñ‡ÐµÑÑ‚Ð²Ð¾ Ð´Ð¾ÑÑ‚ÑƒÐ¿Ð½Ñ‹Ñ… Ð±Ð¸Ð»ÐµÑ‚Ð¾Ð²
    int GetAvailable() const {
        return tickets_.size();
    }

    // Ð¿Ð¾Ð»ÑƒÑ‡Ð¸Ñ‚ÑŒ ÐºÐ¾Ð»Ð¸Ñ‡ÐµÑÑ‚Ð²Ð¾ Ð´Ð¾ÑÑ‚ÑƒÐ¿Ð½Ñ‹Ñ… Ð±Ð¸Ð»ÐµÑ‚Ð¾Ð² Ð¾Ð¿Ñ€ÐµÐ´ÐµÐ»Ñ‘Ð½Ð½Ð¾Ð³Ð¾ Ñ‚Ð¸Ð¿Ð°
    int GetAvailable(const string& name) const {
        return count_if(tickets_.begin(), tickets_.end(), [name](const Ticket& key) {
            return key.name == name;
            });
          
    }


    // Ð¾Ñ‚Ð¾Ð·Ð²Ð°Ñ‚ÑŒ ÑÑ‚Ð°Ñ€Ñ‹Ðµ Ð±Ð¸Ð»ÐµÑ‚Ñ‹ (Ð´Ð¾ Ð¾Ð¿Ñ€ÐµÐ´ÐµÐ»Ñ‘Ð½Ð½Ð¾Ð³Ð¾ id)
    void Invalidate(int minimum) {
        for (int i = 0; i < minimum; i++)
        {
            if (!tickets_.empty() && tickets_.front().id <= minimum) {
                tickets_.pop_front();
            }
        }
    }

private:
    int last_id_ = 0;
    deque<Ticket> tickets_;
};


int main()
{
    TicketOffice tickets;

    tickets.PushTicket("Swan Lake"); // id - 0
    tickets.PushTicket("Swan Lake"); // id - 1
    tickets.PushTicket("Boris Godunov"); // id - 2
    tickets.PushTicket("Boris Godunov"); // id - 3
    tickets.PushTicket("Swan Lake"); // id - 4
    tickets.PushTicket("Boris Godunov"); // id - 5
    tickets.PushTicket("Boris Godunov"); // id - 6

    cout << tickets.GetAvailable() << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 7
    cout << tickets.GetAvailable("Swan Lake") << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 3
    cout << tickets.GetAvailable("Boris Godunov") << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 4

    // Invalidate ÑƒÐ´Ð°Ð»Ð¸Ñ‚ Ð±Ð¸Ð»ÐµÑ‚Ñ‹ Ñ Ð½Ð¾Ð¼ÐµÑ€Ð°Ð¼Ð¸ 0, 1, 2:
    tickets.Invalidate(3);

    cout << tickets.GetAvailable() << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 4
    cout << tickets.GetAvailable("Swan Lake") << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 1
    cout << tickets.GetAvailable("Boris Godunov") << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 3

    tickets.PushTicket("Swan Lake"); // id - 7
    tickets.PushTicket("Swan Lake"); // id - 8

    cout << tickets.GetAvailable("Swan Lake") << endl; // Ð’Ñ‹Ð²Ð¾Ð´: 3 
}

function attachEventsListeners() {

    //console.log('TODO:...');
    const BtnDays=document.getElementById('daysBtn');

    const BtnHours=document.getElementById('hoursBtn');
    const BtnMinutes=document.getElementById('minutesBtn');
    const BtnSecond=document.getElementById('secondsBtn');

    //inputFields
    let Inputdays= document.querySelector('div #days');
    let Inputhours= document.querySelector('div #hours');

    let Inputminutes= document.querySelector('div #minutes');
    let Inputseconds= document.querySelector('div #seconds');
    
    //add events
    BtnDays.addEventListener('click',()=>{
      let res1=Number(Inputdays.value)*24;

      Inputhours.value=res1;
      let res2=res1*60;
      Inputminutes.value=res2;
      
      let res3=res2*60;
      Inputseconds.value=res3;
    });

    BtnHours.addEventListener('click',()=>{
      
      Inputdays.value=Number(Inputhours.value)/24;
      Inputminutes.value=Number(Inputhours.value)*60;
      Inputseconds.value=Number(Inputminutes.value)*60;
    });


    BtnMinutes.addEventListener('click',()=>{
      let res1=Number(Inputminutes.value)/60;
      Inputhours.value=res1;
      
      Inputdays.value=Number(Inputhours.value)/24;
      Inputseconds.value=Number(Inputminutes.value)*60;
    });

    BtnSecond.addEventListener('click',()=>{
      Inputminutes.value=Number(Inputseconds.value)/60
      let res1=Number(Inputminutes.value)/60;
      Inputhours.value=res1;   
      Inputdays.value=Number(Inputhours.value)/24;
      
    
    });

   
    
}

