remove_filter( 'sanitize_title', 'sanitize_title_with_dashes' );

// More info here https://wordpress.stackexchange.com/questions/89767/how-to-increase-the-character-limit-for-post-name-of-200
// add our custom hook 
add_filter( 'sanitize_title', 'wpse8170_sanitize_title_with_dashes', 10, 3 );
function wpse8170_sanitize_title_with_dashes( $title, $raw_title = '', $context = 'display' ) {
    $title = strip_tags($title);
    // Preserve escaped octets.
    $title = preg_replace('|%([a-fA-F0-9][a-fA-F0-9])|', '---$1---', $title);
    // Remove percent signs that are not part of an octet.
    $title = str_replace('%', '', $title);
    // Restore octets.
    $title = preg_replace('|---([a-fA-F0-9][a-fA-F0-9])---|', '%$1', $title);

    if (seems_utf8($title)) {
        if (function_exists('mb_strtolower')) {
            $title = mb_strtolower($title, 'UTF-8');
        }
        $title = utf8_uri_encode($title, 1000); // <--- here is the trick!
    }

    $title = strtolower($title);
    $title = preg_replace('/&.+?;/', '', $title); // kill entities
    $title = str_replace('.', '-', $title);

    if ( 'save' == $context ) {
        // Convert nbsp, ndash and mdash to hyphens
        $title = str_replace( array( '%c2%a0', '%e2%80%93', '%e2%80%94' ), '-', $title );

            // Strip these characters entirely
            $title = str_replace( array(
            // iexcl and iquest
            '%c2%a1', '%c2%bf',
            // angle quotes
            '%c2%ab', '%c2%bb', '%e2%80%b9', '%e2%80%ba',
            // curly quotes
            '%e2%80%98', '%e2%80%99', '%e2%80%9c', '%e2%80%9d',
            '%e2%80%9a', '%e2%80%9b', '%e2%80%9e', '%e2%80%9f',
            // copy, reg, deg, hellip and trade
            '%c2%a9', '%c2%ae', '%c2%b0', '%e2%80%a6', '%e2%84%a2',
            // grave accent, acute accent, macron, caron
            '%cc%80', '%cc%81', '%cc%84', '%cc%8c',
        ), '', $title );

        // Convert times to x
        $title = str_replace( '%c3%97', 'x', $title );
    }

    $title = preg_replace('/[^%a-z0-9 _-]/', '', $title);
    $title = preg_replace('/\s+/', '-', $title);
    $title = preg_replace('|-+|', '-', $title);
    $title = trim($title, '-');

    return $title;
}

let arraySize = gets().split(' ').map(Number);
let firstArraySize = arraySize[0];
let secondArraySize = arraySize[1];
let resultArray = [];
let firstArray = gets().split(' ').map(Number);
let secondArray = gets().split(' ').map(Number);

let minLength = Math.min(firstArraySize, secondArraySize);

let remainder = 0;
for (let i = 0; i < minLength; i++) {
    let sum = firstArray[i] + secondArray[i] + remainder;
    remainder = 0;
    if (sum < 10) {
        resultArray.push(sum);
    } else {
        let digit = sum % 10;
        remainder = Math.floor(sum / 10);
        resultArray.push(digit);
    }
}

if (firstArraySize > secondArraySize) {
    for (let i = minLength; i < firstArraySize; i++) {
        let sum = firstArray[i] + remainder;
        remainder = 0;
        if (sum < 10) {
            resultArray.push(sum);
        } else {
            let digit = sum % 10;
            remainder = Math.floor(sum / 10);
            resultArray.push(digit);
        }
    }
} else if (secondArraySize > firstArraySize) {
    for (let i = minLength; i < secondArraySize; i++) {
        let sum = secondArray[i] + remainder;
        remainder = 0;
        if (sum < 10) {
            resultArray.push(sum);
        } else {
            let digit = sum % 10;
            remainder = Math.floor(sum / 10);
            resultArray.push(digit);
        }
    }
}
if (remainder > 0) {
    resultArray.push(remainder);
}

