  async update(id: number, updateElectoralSectionDto: UpdateElectoralSectionDto): Promise<ElectoralSection> {
    const item = await this.electoralSectionRepository.findOneBy({ id });
    if (!item) {
      throw new NotFoundException('Item with ID ${id} not found');
